// src/pages/NovoDono.jsx
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import InputMask from 'react-input-mask';
import api from '../services/api';

export default function NovoDono() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    cpf: '',
    telefone: '',
    endereco: '',
    dataNascimento: '',
    senha: ''
  });
  const [erros, setErros] = useState({});

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const validar = () => {
    const novosErros = {};
    if (!form.nome || !/^[A-Za-zÀ-ÿ\s]+$/.test(form.nome)) {
      novosErros.nome = 'Nome é obrigatório e deve conter apenas letras';
    }
    if (!form.cpf || form.cpf.replace(/\D/g, '').length !== 11) {
      novosErros.cpf = 'CPF deve ter 11 dígitos';
    }
    if (!form.telefone) {
      novosErros.telefone = 'Telefone é obrigatório';
    }
    if (!form.endereco) {
      novosErros.endereco = 'Endereço é obrigatório';
    }
    if (!form.dataNascimento) {
      novosErros.dataNascimento = 'Data de nascimento é obrigatória';
    }
    if (!form.senha || form.senha.length < 6) {
      novosErros.senha = 'A senha deve ter no mínimo 6 caracteres';
    }
    setErros(novosErros);
    return Object.keys(novosErros).length === 0;
  };

  const handleSubmit = async e => {
    e.preventDefault();
    if (!validar()) return;

    try {
      await api.post('/donos', form);
      navigate('/donos');
    } catch (error) {
      console.error('Erro ao cadastrar dono:', error);
    }
  };

  return (
    <div className="container my-5">
      <div className="p-4 border rounded shadow-sm bg-white">
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h2>Novo Dono</h2>
          <div>
            <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
            <Link to="/donos" className="btn btn-dark">Ver Donos</Link>
          </div>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label>Nome</label>
            <input
              type="text"
              className="form-control"
              name="nome"
              value={form.nome}
              onChange={handleChange}
            />
            {erros.nome && <div className="text-danger">{erros.nome}</div>}
          </div>

          <div className="mb-3">
            <label>CPF</label>
            <InputMask
              mask="999.999.999-99"
              className="form-control"
              name="cpf"
              value={form.cpf}
              onChange={handleChange}
            />
            {erros.cpf && <div className="text-danger">{erros.cpf}</div>}
          </div>

          <div className="mb-3">
            <label>Telefone</label>
            <InputMask
              mask="(99) 99999-9999"
              className="form-control"
              name="telefone"
              value={form.telefone}
              onChange={handleChange}
            />
            {erros.telefone && <div className="text-danger">{erros.telefone}</div>}
          </div>

          <div className="mb-3">
            <label>Endereço</label>
            <input
              type="text"
              className="form-control"
              name="endereco"
              value={form.endereco}
              onChange={handleChange}
            />
            {erros.endereco && <div className="text-danger">{erros.endereco}</div>}
          </div>

          <div className="mb-3">
            <label>Data de Nascimento</label>
            <input
              type="date"
              className="form-control"
              name="dataNascimento"
              value={form.dataNascimento}
              onChange={handleChange}
            />
            {erros.dataNascimento && <div className="text-danger">{erros.dataNascimento}</div>}
          </div>

          <div className="mb-3">
            <label>Senha</label>
            <input
              type="password"
              className="form-control"
              name="senha"
              value={form.senha}
              onChange={handleChange}
            />
            {erros.senha && <div className="text-danger">{erros.senha}</div>}
          </div>

          <button type="submit" className="btn btn-primary">Cadastrar Dono</button>
        </form>
      </div>
    </div>
  );
}
